function Feed (){
  const [state, setState] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(async () => {
    if(!loading) return;
    setLoading(false);
    const posts = await API.get('/@me/exercises', createHeader(window.localStorage.getItem('jwt')));
    setState(posts.data);
  });

  const testResponse = query => {
	  console.log(query)
  }

  return (
   <div>
    <SearchBar submissionCall={this.testResponse.bind(this)} />
    <div className="App">
      {
        state.map(post => {
          return <FeedPost
            id={post.id}
            name={post.name}
            image={post.image}
            likes={post.likes}
            liked={post.liked}
            likeable={true}
            muscleGroup={post.muscleGroup}
            type={post.type}
            equipment={post.equipment}
            difficulty={post.difficulty}
            />
        })
      }
    </div>
  </div>
  );
}

export default Feed;
